    constructor(props){
        super(props);

        this.state = {
            collections: SHOP_DATA
        };
    }

    render() {
        const {collections} = this.state;

        return (<div className='shop-page'>
        {
            collections.map(collection => (
                <CollectionPreview />

            ))
        }
        </div>);
    }

}

export default ShopPage;
